import { createMuiTheme } from "@material-ui/core";

export default createMuiTheme({
  palette: {
    primary: {

      // main: "#2176AE"
      main: "#FBB13C"
    },
    secondary: {
      main: "#57B8FF"
    },
    tertiary_brown: {
      main: "#B66D0D"
    },
    tertiary_brownorange: {
      main: "#FBB13C"
    },
    tertiary_redorange: {
      main: "#FE6847"
    }
  }
});
